import Messaging from "./Components/Messaging";
import Login from "./Components/Login";
import { Router,Switch,Route } from "react-router-dom";

function App() {
  return (
    <Router>
    <div className="App">

      <Messaging/>
    </div>

    <Switch>
          <Route path="/chat">
            <Messaging />
          </Route>
        </Switch>
    </Router>
  );
}

export default App;
